import React, { createContext, useState } from "react";
import {MyComp} from "./components/Context";


function App() {
  const myFunction = () => { console.log('see paragraph.')}

  return (
    <>
    <Context.Provider onClick={myFunction}>
            <MyComp/>
    </Context.Provider>
    </>
  );
};

export default App;
